import React from 'react';
import heroImage from '../../assets/hero-image.png';
import './home.css';

const Home = () => {
  return (
    <div
      className="pt-10"
      style={{
        backgroundColor: '#C4B682'
      }}>
      <div className="mx-auto px-6 md:px-20 xxl:px-0 relative" style={{ maxWidth: '1100px' }}>
        <div className="flex justify-around w-full">
          <img src={heroImage} alt="" className=" -mt-8 h-auto" style={{ maxWidth: '50%' }} />
          <div className="w-1/2 flex max-w-40">
            <div className="flex-grow">
              <div className="grid place-items-center">
                <div>
                  <h1 className="font-semibold text-5xl leading-tight max-w-96 mb-5">
                    Where Beauty <br /> Meets Luxury -<br />
                    <span className="text-white">Sugar&apos;d Bare</span>
                  </h1>
                  <p className="max-w-40">
                    Indulge in expert sugaring and top-tier beauty services, all delivered with a
                    warm and welcoming touch.
                  </p>
                  <div className="grid justify-center pt-12">
                    <a href="#" className="flex">
                      <p className="grid place-items-center text-xs font-semibold text-center border-b-2 border-black mr-6">
                        View Services
                      </p>
                      {/* add animation to make button bounce */}
                      <button className="rounded-full bg-white h-9 w-9">
                        <div className="arrow" />
                      </button>
                    </a>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div className="absolute text-center" style={{ top: 150, left: 90 }}>
          <p className="text-white text-4xl font-semibold mb-2">5.0</p>
          <div className="grid place-items-center grid-cols-5  mb-1">
            {[1, 2, 3, 4, 5].map((item, index) => (
              <div key={index}>
                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" width="16" height="16">
                  <path
                    d="M12.0008 17L6.12295 20.5902L7.72105 13.8906L2.49023 9.40983L9.35577 8.85942L12.0008 2.5L14.6458 8.85942L21.5114 9.40983L16.2806 13.8906L17.8787 20.5902L12.0008 17Z"
                    fill="rgba(170,126,9,1)"></path>
                </svg>
              </div>
            ))}
          </div>
          <a href="#">
            <p className="underline font-medium" style={{ fontSize: '10px' }}>
              Google Reviews
            </p>
          </a>
        </div>
      </div>
    </div>
  );
};

export default Home;

